import React, { PureComponent } from 'react';
import './../css/test.css'
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';
const data = [
    {
        name: '2078',
        Projects: 18,
        Cost : 3,
    },
    {
        name: '2079',
        Projects: 32,
        Cost : 375,
    },
    {
        name: '2080',
        Projects: 120,
        Cost : 75,
    },
    {
        name: '2081',
        Projects: 80,
        Cost : 25,
    },
    {
        name: '2082',
        Projects: 3,
        Cost : 12,
    },
    {
        name: '2083',
        Projects: 35,
        Cost : 300,
    },
    {
        name: '2084',
        Projects: 45,
        Cost : 1,
    },
];

export default class Test extends PureComponent {
    render() {
        return (
            <ResponsiveContainer width="100%" height="100%">
                <LineChart
                    layout="vertical"
                    width={500}
                    height={300}
                    data={data}
                    margin={{
                        top: 20,
                        right: 30,
                        left: 20,
                        bottom: 5,
                    }}
                >
                    <CartesianGrid strokeDasharray="3 3" />
                    <XAxis type="number" />
                    <YAxis dataKey="name" type="category" />
                    <Tooltip />
                    <Legend />
                    <Line dataKey="Projects" stroke="#8884d8" />
                    <Line dataKey="Cost" stroke="#82ca9d" />
                </LineChart>
            </ResponsiveContainer>
        );
    }
}
